import React from "react";

const Data = (props) => {
  const { totalSaleAmount, totalSoldItems, totalNotSoldItems } = props;
  return (
    <div className="Data">
      <h4>
        Total Sale Amount: {totalSaleAmount} | Total Sold Items:{" "}
        {totalSoldItems} | Total Not Sold Items: {totalNotSoldItems}
      </h4>
    </div>
  );
};

export default Data;
